import './App.css';

function App() {
  return (
    <div className="App">
        <div className='Header'>
          <h1> Mountains and Rivers </h1>
          <nav>
            <a>Mountains</a>
            <a>Rivers</a>
          </nav>
        </div>
    </div>
  );
}

export default App;
